import React from 'react';

const Navbar = () => {
	return (
		<nav className="navbar bg-light">
			<div>
				<span>
					<i class="fa-solid fa-pen-nib"></i>
					<h3>Stories</h3>
				</span>
			</div>
		</nav>
	);
};

export default Navbar;
